INSERT INTO `dof_actions` VALUES (20,19,3,1,'DÖF oluşturuldu',NULL,NULL,'2025-06-17 13:28:11'),(21,19,2,2,'DÖF Emaar Şube departmanına atandı: Tezgahta yer alan ürünlerin değerlendirilmesi ile oluşan duyusal uygunsuzluk için gerekli aksiyon planlaması yapılmalıdır.',2,3,'2025-06-17 13:31:04'),(22,19,12,2,'Merhabalar hardallı patates Ürünün  raf ömrü 12.06.2025 ürün +2 derece ile sabah 10:00 da tezgaha açılmıştır üründe duyusal yapılmıştır herhangi bi problem  olmamıştır. gün içerisinde ürün sürekli olarak yenilenerek tezgaha konulmuştur. Et yemeği olarak o gün domates soslu etimiz vardı skt olarak raf ömrü 10.06.2025 dir herhangi bi misafirimizden  ürün hakkında kötü bi dönüş olmadı sözlü olarak. tezgahta ürün duyusalı yapılmıştır. ürünün sert olması ısınma süresi ile ilgili olabilme ihtimali olabilir, bazı misafirlerimiz ürünün fazla ısıtılmasını talep ediyor, ürün 260 derece ile ısındığı için üzerinde kuruma ihtimalı olmuş olabilir fazla ısıtıldığı için. Personellere ürün ısınma süreleri hakkında tekrar eğitim verilecektir.',3,8,'2025-06-17 17:42:20'),(23,19,12,1,'Merhabalar Ürünün raf ömrü 12.06.2025 ürün +2 derece ile sabah 10:00 da tezgaha açılmıştır üründe duyusal yapılmıştır herhangi bi problem  olmamıştır. gün içerisinde ürün sürekli olarak yenilenerek tezgaha konulmuştur. Et yemeği olarak o gün domates soslu etimiz vardı skt olarak raf ömrü 10.06.2025 dir herhangi bi misafirimizden  ürün hakkında kötü bi dönüş olmadı sözlü olarak. tezgahta ürün duyusalı yapılmıştır. ürünün sert olması ısınma süresi ile ilgili olabilme ihtimali olabilir, bazı misafirlerimiz ürünün fazla ısıtılmasını talep ediyor, ürün 260 derece ile ısındığı için üzerinde kuruma ihtimalı olmuş olabilir fazla ısıtıldığı için. Personellere ürün ısınma süreleri hakkında tekrar eğitim verilecektir.',NULL,NULL,'2025-06-17 17:45:00'),(24,19,2,2,'Verilen eğitimlerin sonraki DF\'lerde görselleri ekleyiniz.',8,9,'2025-06-17 20:37:34'),(25,19,12,3,'Aksiyonlar Emaar Şube tarafından tamamlandı.',9,11,'2025-06-17 20:49:19'),(26,19,3,2,'DÖF çözümü kaynak departman tarafından onaylanmıştır.',11,5,'2025-06-18 12:29:27'),(27,20,3,1,'DÖF oluşturuldu',NULL,NULL,'2025-06-18 13:54:01'),(28,19,2,2,'kapatıldı.',5,6,'2025-06-18 16:21:26'),(29,20,2,2,'DÖF Zorlu Şube departmanına atandı: Müşteri şikayet bildirimi net anlaşılır değil. Müşteri yaklaşımı ve memnuniyeti (personel yaklaşımı) olarak kök neden değerlendirmesi gerçekleştirelim.',2,3,'2025-06-18 19:02:33'),(30,20,20,2,'',3,8,'2025-06-18 19:45:21'),(31,21,3,1,'DÖF oluşturuldu',NULL,NULL,'2025-06-19 12:21:35'),(32,20,2,2,'Aksiyonunuzu kapatırken, eğitim kayıtlarının tutulmuş olması gerekmektedir.',8,9,'2025-06-19 15:06:20'),(33,21,2,1,'Online sipariş dönüşüdür. Servis gitmemiş ve dönüş sağlanmıştır. ',NULL,NULL,'2025-06-19 15:11:40'),(34,21,2,2,'DÖF Acarkent Şube departmanına atandı: Online sipariş dönüşüdür. Servis gitmemiş ve dönüş sağlanmıştır. Bu konu baz alınarak DF çalışması gerçekleştirilmelidir.',2,3,'2025-06-19 15:12:44'),(35,21,14,2,'',3,8,'2025-06-19 17:12:52'),(36,21,2,2,'Gerekli sürecin tamamlanması için ilgili yazışmanın görselini de (mail yazışması) ekleyerek DF kapama işlemi yapalım.',8,9,'2025-06-19 17:25:55'),(37,22,3,1,'DÖF oluşturuldu',NULL,NULL,'2025-06-20 12:37:11'),(38,23,3,1,'DÖF oluşturuldu',NULL,NULL,'2025-06-20 12:38:37'),(39,22,2,2,'DÖF Suadiye Şube departmanına atandı: El ile yazı mı gönderilmekte? Bu işleyiş için kreatiften onaylı yazı metni ve baskılar geldi. harici birşey mi kullanılmakta. Hem bunu hem de müşteri şikayetini ayrıca değerlendirelim.',2,3,'2025-06-20 14:03:00'),(40,20,20,3,'Aksiyonlar Zorlu Şube tarafından tamamlandı.',9,5,'2025-06-20 14:12:37'),(41,23,2,2,'DÖF Kalite Yönetimi departmanına atandı: .',2,3,'2025-06-20 14:20:06'),(42,23,2,3,'Departman değiştirildi: Kalite Yönetimi -> Beraber Kalite',NULL,NULL,'2025-06-20 11:44:30'),(43,20,2,2,'Eğitim kayıtlarını kontrollerde bakılabilecek şekilde kayıt altında tutunuz.',5,6,'2025-06-20 14:56:28');
