INSERT INTO `dofs` VALUES (19,'MU-EM-DU-MU-001','Emaar Misafir Geri Bildirimi ','Et açıkta beklediği için kurumuş ve sertleşmişti. Hardallı patatesin sosu diğer şubelerde yediğimden çok farklı, mayonezli patates salatası gibiydi. Ödediğim paranın karşılığını aldığımı düşünmüyorum',1,3,6,4,3,NULL,'2025-06-17 13:28:11','2025-06-18 16:21:26',NULL,'2025-06-18 16:21:26','üründe fazla ısınma olma ihtimali','tezgah arka kısımda tezgah açıklığı sebebi ile ürünün açıkta kalması','Et in  skt si nin aynı gün olması 10.06 skt tarihi','','','2025-06-17 03:00:00','Personellere Ürün ısınma ve raf ömürleri hakkında yeniden eğitim verilmesi. Üründe  duyusalın sürekli olarak yapılması konusunda aksiyon alınmıştır.',NULL,'website','2025-06-10 03:00:00'),(20,'MU-ZO-DU-MU-001','Zorlu Misafir Geri Bildirimi ','Devamlı geldiğim yerdi artık gelmeyeceğim. Berbatlar, çalışanları değişti sanırım berbat bir hizmet',1,3,6,11,3,NULL,'2025-06-18 13:54:01','2025-06-20 14:56:28',NULL,'2025-06-20 14:56:28','Yeni başlayan personellerin eğitim süreçlerini mağaza işleyişi sırasında deneyimlemesi','Mağaza ergonomik yapısı kaynaklı yoğunluk anlarında oluşan kaos','Mola ve vardiya geçişlerinde farklı pozisyonlardaki personellerin yer değiştirmesi','','','2025-06-18 03:00:00','Personellere misafir iletişimi ile ilgili eğitim verilecektir. Yeni başlayan personeller ilk hafta daha geri planda tutulup daha sıkı eğitim verildikten sonra kademeli olarak işleyişe dahil edilecektir. İş geçişlerinde farklı pozisyonda görev alan personeller içinde eğitim sonrası daha sıkı gözlem yapılarak belli bir seviyeye girmeden yoğunluk anlarında görev yeri değiştirilmeyecektir.',NULL,'google','2025-06-17 03:00:00'),(21,'MU-AC-DU-MU-001','Acarkent Bowl Misafir Geri Bildirimi ','Servis yoktu',1,3,9,6,3,NULL,'2025-06-19 12:21:35','2025-06-19 17:25:55',NULL,NULL,'Şube tarafımızda paket servislerimiz bitmiş durumdadır. Depo tarafımızdan sipariş etmemize rağmen stok olmadığından şubeye gönderim yapılmamıştır. Bu nedenle misafirlerimize paket siparişinde servis gönderememekteyiz.','Şube tarafımızda paket servislerimiz bitmiş durumdadır. Depo tarafımızdan sipariş etmemize rağmen stok olmadığından şubeye gönderim yapılmamıştır. Bu nedenle misafirlerimize paket siparişinde servis gönderememekteyiz.','Şube tarafımızda paket servislerimiz bitmiş durumdadır. Depo tarafımızdan sipariş etmemize rağmen stok olmadığından şubeye gönderim yapılmamıştır. Bu nedenle misafirlerimize paket siparişinde servis gönderememekteyiz.','','','2025-06-30 03:00:00','Operasyon ile görüşüldü. Depo tarafından eksik servis ekipmanlarının temini beklenmektedir.\r\n',NULL,'yemeksepeti','2025-06-18 03:00:00'),(22,'MU-SU-DU-MU-001','Yemeksepeti Suadiye Bowl & Wrap Misafir Geri Bildirimi ','Kapağın üstüne bu güzel yemekte ne eksik? 5 yıldız vermeniz demişsiniz. Bunu yazana kadar keşke pilavımı koysaymışsınız. Eksik olan şey pilavım oldu. ',1,3,3,8,3,NULL,'2025-06-20 12:37:11','2025-06-20 14:03:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'yemeksepeti','2025-06-19 03:00:00'),(23,'MU-KA-DU-MU-001','Yemeksepeti Hisar Misafir Geri Bildirimi ','Sarma çok tuzlu',1,3,3,31,3,NULL,'2025-06-20 12:38:37','2025-06-20 14:44:30',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'yemeksepeti','2025-06-20 03:00:00');
