INSERT INTO `thank_you` VALUES (1,'Yemeksepeti/ Personel','çalışan çok ilgilendi teşekkürler',3,3,'2025-06-17 10:38:03',1),(2,'Kanyon Google Teşekkür Yorumu','Yiyecek konusunda hem çok titizler hemde çok lezzetliler çalışanların hepsi güler yüzlü ve çok ilgililer kanyon şubesi her Konuda çok iyi',5,3,'2025-06-18 10:55:32',1),(3,'17.06.2025 Yemeksepeti- Caddebostan Mezze Yorumları','-Leziz\r\n-yemekler cok basarılı\r\n-herzaman ki gibi muhteşem di\r\n-Çok lezzetli ve ikram için teşekkürler',9,3,'2025-06-19 09:16:16',1),(4,'Kanyon Google Misafir Olumlu Geri Bildirimleri','-Her zaman taze ve güzel çeşitler; emeklerinize teşekkürler.\r\n\r\n-Çalışanları çok tatlı ve yardımcı, öğlen yemeklerimizin vazgeçilmezi',5,3,'2025-06-20 09:40:11',1),(5,'Google Prototype Olumlu Misafir Geri Bildirimi','Yemekler oldukça lezzetli ve doyurucu',22,3,'2025-06-20 09:46:37',1),(6,'Caddebostan Mezze Google Olumlu Misafir Geri Bildirimi ','Selin Hanima ilgisi, muthis enerjisi ve guleryuzu için teşekkür ederiz.',9,3,'2025-06-20 09:48:59',1),(7,'Suadiye Google Olumlu Misafir Geri Bildirimi ','Kendi bowlunu oluşturabilmek çok güzel, özellikle vegan bir çok seçenecek mevcut',8,3,'2025-06-20 09:51:41',1);
